import {GET_IMAGES, IMAGES_ERROR} from '../types'
import axios from 'axios'

export const getImages = () => async dispatch => {

    try{
        const res = await axios.get(`https://api.nasa.gov/mars-photos/api/v1/rovers/curiosity/photos?sol=1000&page=2&api_key=rpf2PXcZhgOIA7Tjek38tFq5HDa7a5dsUgDiuVo1
        `)
        dispatch( {
            type: GET_IMAGES,
            payload: res.data
        })
    }
    catch(e){
        dispatch( {
            type: IMAGES_ERROR,
            payload: console.log(e),
        })
    }

}
